import React from 'react';
import Header from '../header/Header';

function home() {
   return (
      <div className="container">
         <div className="home">
            <Header />
            <h1>Recipe App</h1>
            <p>Keep track of all your favorite recipes</p>
         </div>
      </div>
   )
}

export default home
